import React from 'react';
import './Products.css';

function Products() {
  return (
    <>
    <div className='all-products'>
        <div className='wrapper'>
            <div className='top_bar'>
                <ul>
                    <li className='home'><a href='/Home'>Home /</a></li>
                    <li>Products</li>
                </ul>
            </div>
        </div>
    </div>
    </>
  )
}

export default Products;
